import React from 'react';

const VideoItem = ({ video, onUpVote, onDownVote, onDelete }) => {
  return (
    <div className="video-container mt-5">
      <h3>{video.title}</h3>
      <iframe
        src={`https://www.youtube.com/embed/${video.url}`}

        title={video.title}
        width="560"
        height="315"
        frameBorder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
        allowFullScreen
      ></iframe>
      <p>Votes: {video.votes}</p>
      <button onClick={() => onUpVote(video)}>Up Vote</button>
      <button onClick={() => onDownVote(video)}>Down Vote</button>
      <button onClick={() => onDelete(video)}>Delete</button>
    </div>
  );
};

export default VideoItem;
